const input = document.getElementById("FileInput");
const newTextInput = document.getElementById("TextInput");
const fileNameInput = document.getElementById("FileNameInput");

function _arrayBufferToBase64(buffer) {
    var binary = "";
    var bytes = new Uint8Array(buffer);
    var len = bytes.byteLength;
    for (var i = 0; i < len; i++) {
        binary += String.fromCharCode(bytes[i]);
    }
    return window.btoa(binary);
}

function _base64ToArrayBuffer(base64) {
    var binary_string = window.atob(base64);
    var len = binary_string.length;
    var bytes = new Uint8Array(len);
    for (var i = 0; i < len; i++) {
        bytes[i] = binary_string.charCodeAt(i);
    }
    return bytes.buffer;
}

let base64 =
    "";
let newArrayBuffer;
let arrayBuffer;
let newByte;
let fileName = "main.exe";
input.addEventListener("change", e => {
    const selectedFile = input.files[0];
    if (!selectedFile) return;
    selectedFile.arrayBuffer().then(resp => {
        arrayBuffer = resp;
        var view = new Uint8Array(arrayBuffer);
        base64 = _arrayBufferToBase64(arrayBuffer);
        //newArrayBuffer = _base64ToArrayBuffer(base64)
        /*console.log(new File([arrayBuffer], 'main.exe', {
  type: "text/plain",
}))*/
        generateLink();
    });
});
generateLink = e => {
    newArrayBuffer = _base64ToArrayBuffer(base64);
    var view = new Uint8Array(newArrayBuffer);
    for (let i = 0; i < 256; i++) {
        if (newTextInput.value.charCodeAt(i)) {
            newByte = newTextInput.value.charCodeAt(i);
        } else {
            newByte = 32;
        }
        if (newByte === 1025) {
            newByte = 193 + 48 - 1;
        }
        if (newByte === 1105) {
            newByte = 194 + 48 - 1;
        }
        if (newByte === 1028) {
            newByte = 195 + 48 - 1;
        }
        if (newByte === 1108) {
            newByte = 196 + 48 - 1;
        }
        if (newByte === 1031) {
            newByte = 197 + 48 - 1;
        }
        if (newByte === 1111) {
            newByte = 198 + 48 - 1;
        }

        if (newByte > 1087) {
            newByte += 48;
        }
        newByte -= newByte > 256 ? 912 : 0;
        view[12868 + i] = newByte;
    }
    newbase64 = _arrayBufferToBase64(newArrayBuffer);
    /*console.log(new File([arrayBuffer], 'main.exe', {
type: "text/plain",
}))*/
    document.querySelector("#OutputLink").href =
        "data:application/octet-stream;charset=utf-8;base64," + newbase64; // Zm9vIGJhcg=='
    document.querySelector("#OutputLink").download = fileName;
};
newTextInput.addEventListener("change", generateLink);
newTextInput.addEventListener("input", generateLink);

const setName = e => {
    fileName = e.target.value;
    generateLink();
};
fileNameInput.addEventListener("change", setName);
fileNameInput.addEventListener("input", setName);
generateLink();
